0.ds_documentacao:
a. Certificado de Conclusão do Ensino Médio ou equivalente;
b. Histórico Escolar do Ensino Médio ou equivalente atestando a conclusão do
Ensino Médio;
c. Documento de Identificação com foto e número de CPF (RG, Carteira de
Habilitação) ou Cédula de Identidade para estrangeiros (RNE);
d. Certidão de registro do consulado (para estrangeiros);
e. Certidão de alistamento militar ou carteira de reservista ou ainda
certificado de dispensa militar (para maiores de 18 anos);
f. Duas fotos 3x4 recentes e identificadas com o nome no verso;
g. Comprovante de endereço atualizado;
h. Certidão de regularidade da situação do CPF ou declaração escrita e
assinada pelo candidato;
i. Certidão de quitação eleitoral ou declaração escrita e assinada pelo
candidato.

